import React from "react";
import "../Main.css";
import logo from "../images/molloy-logo.png";
export default function Main() {
  return (
    <main className="main">
      <img
        src={logo}
        className="molloy-logo"
        alt="logo of molloy unviersity"
      ></img>
    </main>
  );
}
